import React from 'react';
import './HomePage.css';

function HomePage() {
  return (
    <div className="hero">
      <h1>Welcome to Dubai Project</h1>
      <p>Enhancing Marketing and Cooperation in Dubai</p>
    </div>
  );
}

export default HomePage;
